import React, {Component} from 'react';
import styled from 'styled-components';

const Container = styled.div`
    display: box;
    height: 62vh;
    width: 212px;

    background-color: #000;
`

class Card extends Component {
    render (){
        return (
            <div>
                <Container>Hello</Container>
            </div>
        );
    }
}

export default Card;
